import express from 'express';
import morgan from 'morgan';

//Import de los Routers
import viewRouter from './routers/router.view';
import userRouter from './routers/router.user';

//TODO: Constantes
const app = express();
const PORT = 3000 || process.env.PORT;
const defaultRoute = '/api/LuzMelyShop';

//TODO: Se definira el puerto
app.set('port', PORT);

//TODO: Se configura el motor de las vistas
app.set('view engine', 'ejs');
app.set('views', __dirname + '/views');

//TODO: Se configura el Middleware
app.use(express.static(__dirname + '/public'));
app.use(morgan('dev'));
app.use(express.json());
app.use(express.urlencoded({
  extended: true
}));

//TODO: Se agregan los routers
app.use(defaultRoute, viewRouter);
app.use(defaultRoute,userRouter)

//TODO: En dado caso que el usaurio se meta aun ruta equivocada 
app.use('/', (req, res) => {
  let headerTitle = 'Tienda LuzMeri';
  let user = undefined;
  res.render('index', {
    headerTitle: headerTitle,
    user: user,
    dirNavBar: 'components/nav_bar/nav_bar_home',
    dirHeader: 'components/header/header',
    dir: 'components/others/err_404',
    dirFooter: 'components/footer/footer',
  });
});

export default app;

