import { loginModel } from "../model/model.login";

function getLoginView (req,res){
    res.render('index',{
        dirNavBar : 'components/nav_bar/nav_bar_home',
        dirHeader : 'components/header/header_home',
        dir:'components/others/login',
        dirFooter : 'components/footer/footer'
    });
}

function logeoInit (req,res){
    let { userName, passWord } = req.body;
    loginModel.logeo(userName, passWord).then(result => {
      if(result != 0){
        res.render('index', {
          dirNavBar: 'components/nav_bar/nav_bar_user_home',
          dirHeader: 'components/header/header_user_home',
          dir: 'components/others/user_home',
          dirFooter: 'components/footer/footer',
        });
      }else{
        res.render('index', {
          dirNavBar: 'components/nav_bar/nav_bar_home',
          dirHeader: 'components/header/header_home',
          dir: 'components/others/user_not_found',
          dirFooter: 'components/footer/footer',
        });
      }
  }).catch(err => {
    res.send(err);
  });
}

export const loginControl ={
    getLoginView,
    logeoInit
}

