import { userRegisterModel } from "../model/model.userregister";

function getRegisterClientView(req, res) {
    res.render('index', {
        dirNavBar: 'components/nav_bar/nav_bar_home',
        dirHeader: 'components/header/header_home',
        dir: 'components/others/register',
        dirFooter: 'components/footer/footer'
    });
}

function postRegisterClient(req, res) {
    let newClient = req.body;
    console.log(newClient);
    userRegisterModel.userRegister(newClient).then(result => {
        res.render('index', {
            dirNavBar: 'components/nav_bar/nav_bar_home',
            dirHeader: 'components/header/header_home',
            dir: 'components/others/login',
            dirFooter: 'components/footer/footer'
        });
    }).catch(err => {
        res.send(err).status(500);
    });
}

export const userRegisterControl = {
    getRegisterClientView,
    postRegisterClient
}

