import { userModel } from "../model/model.user";

function userLoginControl(req, res) {
  let { userName, passWord } = req.body;
  userModel.logeo(userName, passWord).then(result => {
    if (result != 0) {
      res.render('index', {
        headerTitle: 'Tienda LuzMeri',
        user: JSON.stringify(result),
        dirNavBar: 'components/nav_bar/nav_bar_user_home',
        dirHeader: 'components/header/header',
        dir: 'components/others/categories',
        dirFooter: 'components/footer/footer'
      });
    } else {
      res.render('index', {
        headerTitle: 'Tienda LuzMeri',
        user: undefined,
        dirNavBar: 'components/nav_bar/nav_bar_home',
        dirHeader: 'components/header/header',
        dir: 'components/others/user_not_found',
        dirFooter: 'components/footer/footer'
      });
    }
  }
  ).catch(err => {
    res.send(err);
  }
  );
}

function userRegister(req,res){
  let newClient = req.body;
    console.log(newClient);
    userModel.Register(newClient).then(result => {
        res.render('index', {
            headerTitle: 'Tienda LuzMeri',
            user: undefined,
            dirNavBar: 'components/nav_bar/nav_bar_home',
            dirHeader: 'components/header/header',
            dir: 'components/others/login',
            dirFooter: 'components/footer/footer'
        });
    }).catch(err => {
        res.send(err).status(500);
    });
}

function userAcountDelete (req,res){
  let userId = req.params.id;
  userModel.acountDelete(userId).then(result =>{
    if(result == 1){
      res.render('index', {
        headerTitle: 'Tienda LuzMeri',
        user: undefined,
        dirNavBar: 'components/nav_bar/nav_bar_home',
        dirHeader: 'components/header/header',
        dir: 'components/others/home',
        dirFooter: 'components/footer/footer'
    });
    }
  }).catch( err =>{
    console.log(err);
  });
}

function userInfoUpdate(req,res){
  let {id} = req.body;
  console.log(id);
  let {nombre,apellidos,correo_electronico,usuario,contrasena} = req.body;
  let update = {nombre,apellidos,correo_electronico,usuario,contrasena}; 
  userModel.infoUpdate(id,update).then(result =>{
    if(result == 1){
      res.render('index', {
        headerTitle: 'Tienda LuzMeri',
        user: JSON.stringify({
          id: id,
        }),
        dirNavBar: 'components/nav_bar/nav_bar_user_home',
        dirHeader: 'components/header/header',
        dir: 'components/others/categories',
        dirFooter: 'components/footer/footer'
    });
    }
  }).catch(err => {
    console.log(err);
  });
}

export const userControl = {
  userLoginControl,
  userRegister,
  userAcountDelete,
  userInfoUpdate
};

