import { Router } from "express";
import { viewControl } from "../controller/control.view";

const viewRouter = Router();

viewRouter.get('/view/home',viewControl.getHomeView);
viewRouter.get('/view/home/user:id',viewControl.getHomeUserView);
viewRouter.get('/view/login',viewControl.getLoginView);
viewRouter.get('/view/register',viewControl.getRegisterView);
viewRouter.get('/view/blouses/:id',viewControl.getBlousesView);
viewRouter.get('/view/blouses/model1/:id',viewControl.getBlouses1View);
viewRouter.get('/view/userInfo/:id',viewControl.getUserInfoView);


export default viewRouter;

