import { userModel } from "../model/model.user";

//Obtiene la vista de inicio
function getHomeView(req,res){
    res.render('index',{
        headerTitle : 'Tienda LuzMeri',
        user : 'undefined',
        dirNavBar : 'components/nav_bar/nav_bar_home',
        dirHeader : 'components/header/header',
        dir:'components/others/home',
        dirFooter : 'components/footer/footer'
    });
}
//Obtiene la vista del inicio de usuario
function getHomeUserView(req,res){
    res.render('index',{
        headerTitle : 'Tienda LuzMeri',
        user : 'undefined',
        dirNavBar : 'components/nav_bar/nav_bar_user_home',
        dirHeader : 'components/header/header',
        dir:'components/others/categories',
        dirFooter : 'components/footer/footer'
    });
}
//Obtiene la vista del login
function getLoginView (req,res){
    res.render('index',{
        headerTitle : 'Tienda LuzMeri',
        user : 'undefined',
        dirNavBar : 'components/nav_bar/nav_bar_home',
        dirHeader : 'components/header/header',
        dir:'components/others/login',
        dirFooter : 'components/footer/footer'
    });
}
//Obtiene la vista del registro de usuario
function getRegisterView (req,res){
    res.render('index',{
        headerTitle :'Tienda LuzMeri',
        user : 'undefined',
        dirNavBar : 'components/nav_bar/nav_bar_home',
        dirHeader : 'components/header/header',
        dir:'components/others/register',
        dirFooter : 'components/footer/footer'
    });
}
//obtiene las bistas de blusas
function getBlousesView (req,res){
    let id = req.params.id;
    res.render('index',{
        headerTitle :'Tienda LuzMeri',
        user : JSON.stringify({
            id : id
        }),
        dirNavBar : 'components/nav_bar/nav_bar_user_home',
        dirHeader : 'components/header/header',
        dir:'components/others/blouses_page',
        dirFooter : 'components/footer/footer'
    });
}

function getBlouses1View(req,res){
    let id = req.params.id;
    res.render('index',{
        headerTitle :'Tienda LuzMeri',
        user : JSON.stringify({
            id : id
        }),
        dirNavBar : 'components/nav_bar/nav_bar_user_home',
        dirHeader : 'components/header/header',
        dir:'components/others/blouses_1',
        dirFooter : 'components/footer/footer'
    });
}

function getUserInfoView(req,res){
    userModel.getInfo(req.params.id).then(result =>{
        console.log(result);
        res.render('index',{
            headerTitle :'Tienda LuzMeri',
            user : JSON.stringify(result),
            dirNavBar : 'components/nav_bar/nav_bar_user_home',
            dirHeader : 'components/header/header',
            dir:'components/others/user_info',
            dirFooter : 'components/footer/footer'
        });
    }).catch(err =>{

    })
}

export const viewControl ={
    getHomeView,
    getHomeUserView,
    getLoginView,
    getRegisterView,
    getBlousesView,
    getUserInfoView,
    getBlouses1View
}

