import { connectionDB } from "../database/database.conection";

async function logeo(_userName, _passWord) {
  let conection = await connectionDB.getConnection();
  let resultArray = await conection.query(`call bd_tienda_ropa.tbl_client_login_sp('${_userName}', '${_passWord}');`);
  let resultBD;
  /*Fragmento de codigo que limpia los
    datos que bienen desde la base de datos*/
  if (resultArray[0].length != 0) {
    resultBD = resultArray[0][0];
  } else {
    resultBD = 0;
  }
  return new Promise(result => {
    result(resultBD);
  });
}

async function getInfo(id) {
  let conection = await connectionDB.getConnection();
  let resultArray = await conection.query(`call bd_tienda_ropa.tbl_client_getinfo_sp( '${id}');`);
  let resultBD;
  /*Fragmento de codigo que limpia los
    datos que bienen desde la base de datos*/
  if (resultArray[0].length != 0) {
    resultBD = resultArray[0][0];
  } else {
    resultBD = 0;
  }
  return new Promise(result => {
    result(resultBD);
  });
}

async function Register(newClient) {
  let conection = await connectionDB.getConnection();
  await conection.query(`call tb_cliente_insert_sp('${newClient.name}', '${newClient.surname}', '${newClient.email}', 2, '${newClient.userName}', '${newClient.password}');`);
  return new Promise(result => {
    result(1);
  });
}

async function acountDelete(id) {
  let conection = await connectionDB.getConnection();
  await conection.query(`call bd_tienda_ropa.tbl_client_delete_acount_sp(${id});`);
  return new Promise(result => {
    result(1);
  });
}

async function infoUpdate(id, update) {
  console.log(update);
  let conection = await connectionDB.getConnection();
  await conection.query(`UPDATE tbl_cliente SET ? where id = ?`, [update, id]);
  return new Promise(result => {
    result(1);
  });
}

export const userModel = {
  logeo,
  Register,
  getInfo,
  acountDelete,
  infoUpdate
};

